const Discord = require('discord.js');
const { Client, MessageEmbed } = require('discord.js');
const marsnpm = require('marsnpm');

module.exports = {
  name: "kill",
  alias: [""],

async execute (client, message, args){



   if (!message.channel.permissionsFor(client.user).has("EMBED_LINKS"))return message.channel.send("❌ | No tengo permisos de **EMBED_LINKS** en este canal.");

  let mention = message.mentions.members.first()

  if(!mention) return message.channel.send("❌ | Menciona a alguien")  

if (mention.id === message.author.id) return message.channel.send('❤️ | No te mates a ti mismo yo te aprecio.')



    let kill = await marsnpm.kill();
    const embed = new Discord.MessageEmbed() //Embed
      .setTitle(`${message.member.displayName} Mato a ${mention.displayName}`)
    .setColor("RANDOM") //Color
      .setImage(kill); //La imagen que es sleep.
    message.channel.send(embed);
}
 }

}

