client.on('messageDeleteBulk', async (messages, message) => {
const logs = new db.crearDB("logs")
const db = require("megadb")
const length = messages.array().length;
const canal = messages.first().channel.name;

const embed = new Discord.MessageEmbed()

.setTitle(`Wumpus Logs`)
.setDescription(messages.map(message => `${length} mensajes borrados en ${canal} por ${message.author.tag} \n **${message.content}**`))
.setColor("RANDOM")
.setTimestamp()

const Canal = await logs.obtener(messages.first().guild.id)

client.channels.cache.get(Canal).send(embed)

})
